import React from 'react';
import { PageContainer } from '../../Pagecontainer';
export function VisualGraph() {
    return (
        <PageContainer>
            <h2 className="text-2xl font-semibold mb-4">Historical Knowledge Graph</h2>
            <div className="flex flex-col items-center space-y-4">
                <div className="w-full max-w-md bg-white p-4 shadow-md rounded">
                    {/* Timeline */}
                    <div className="flex justify-between text-sm text-gray-700 mb-4">
                        <span>476 CE</span>
                        <span>800 CE</span>
                        <span>1066 CE</span>
                    </div>
                    {/* Knowledge Graph */}
                    <div className="flex justify-center items-center mt-4">
                        {/* Example nodes */}
                        <div className="bg-gray-300 w-24 h-24 rounded-full flex items-center justify-center">Europe</div>
                    </div>
                </div>
                <div className="flex space-x-2">
                    <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Zoom In</button>
                    <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Zoom Out</button>
                    <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Center Graph</button>
                </div>
            </div>
        </PageContainer>
    );
}
